import {
  Box,
  Flex,
  Text,
  Grid,
  Button,
  Heading,
  Spinner,
} from "@chakra-ui/react";
import { useLocation } from "react-router-dom";
import Navbar from "./navbar";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";
//import { useCustomToast } from "./showToast";
import { useEffect, useState } from "react";
import 'jspdf-autotable';
import FieldTitle from "./standardTitle";

declare global {
  interface Window {
    dataFromParent: any;
  }
}
declare module 'jspdf' {
  interface jsPDF {
      lastAutoTable: { finalY: number };
  }
}

const VisualizationPage = () => {
  const location = useLocation();
  const record = location.state.record;
  //const { _showErrorToast } = useCustomToast();
  const pezzi = record.pezzi;
  const acconti = record.acconti;
  const stato = record.stato
  const [selectedStatus, setSelectedStatus] = useState<any>()
  const [isLoading, setIsLoading] = useState(false);
  //console.log(record);

  const statusMap: { [key: string]: keyof typeof stato } = {
    "ðŸ”µ": "inCorso",
    "ðŸŸ¢": "completed",
    "ðŸŸ¡": "standby",
    "ðŸŸ ": "problem",
    "ðŸ”´": "canceled",
  };

  useEffect(() => {
    const selectedStatusCalc =
      Object.entries(statusMap).find(([_emoji, key]) => stato[key])?.[0] ||
      "ðŸ”µ"; // Default to ðŸ”µ if no value is true
    setSelectedStatus(selectedStatusCalc);
  }, [record]);

  const img =
    " data:image/png;base64,";

  
  const timestampToDate = (timestamp: any) => {
    return new Date(timestamp.seconds * 1000 + timestamp.nanoseconds / 1000000);
  };

  const downloadFile = async () => {
    
    setIsLoading(true)
    const doc = new jsPDF("portrait");

    // Set up the header
    doc.addImage(img, "JPEG", 45, 20, 120, 35);
    doc.setFontSize(36);

    // General information table
    autoTable(doc, {
      startY: 73,
      headStyles: {
        fillColor: [135, 0, 0], // RGB color for the background of headers
      },
      body: [
        {
          cliente: record.nomeCliente,
          titolo: record.titolo,
          modello: record.veicolo.modello,
          vim: record.veicolo.vim,
        },
      ],
      columns: [
        { header: "Cliente", dataKey: "cliente" },
        { header: "Titolo", dataKey: "titolo" },
        { header: "Modello", dataKey: "modello" },
        { header: "VIM", dataKey: "vim" },
      ],
    });

    // Details of the intervention
    autoTable(doc, {
      startY: doc.lastAutoTable.finalY + 10,
      headStyles: {
        fillColor: [135, 0, 0], // RGB color for the background of headers
      },
      body: [
        {
          dataInizio: `${timestampToDate(record.dataInizio).toLocaleDateString()}`,
          dataFine: `${timestampToDate(record.dataFine).toLocaleDateString()}`,
          problema: record.problema || "Non specificato",
          tecnico: record.tecnico || "Non specificato",
          ore: record.oreLav,
          intervento: record.titolo || "Non specificato",
          note: record.note || "Nessuna nota",
          stato: record.stato.canceled
            ? "Cancellato"
            : record.stato.completed
            ? "Completato"
            : record.stato.inCorso
            ? "In Corso"
            : record.stato.problem
            ? "Problema"
            : record.stato.standby
            ? "Stand By"
            : "Non specificato",
        },
      ],
      columns: [
        { header: "Data Inizio", dataKey: "dataInizio" },
        { header: "Data Fine", dataKey: "dataFine" },
        { header: "Ore Lavorate", dataKey: "ore" },
        { header: "Tipo Intervento", dataKey: "intervento" },
        { header: "Note", dataKey: "note" },
        { header: "Stato", dataKey: "stato" },
      ],
    });

    // Information on parts and payments
    autoTable(doc, {
      startY: doc.lastAutoTable.finalY + 10,
      headStyles: {
        fillColor: [135, 0, 0], // RGB color for the background of headers
      },
      body: record.pezzi.map((pezzo: any) => ({
        nome: pezzo.name,
        quantita: pezzo.qta,
        prezzo: pezzo.price + "â‚¬",
        fornitore: pezzo.fornitor,
      })),
      columns: [
        { header: "Pezzo", dataKey: "nome" },
        { header: "QuantitÃ ", dataKey: "quantita" },
        { header: "Prezzo", dataKey: "prezzo" },
        { header: "Fornitore", dataKey: "fornitore" },
      ],
    });

    autoTable(doc, {
      startY: doc.lastAutoTable.finalY + 10,
      headStyles: {
        fillColor: [135, 0, 0], // RGB color for the background of headers
      },
      body: record.acconti.map((acconto: any) => ({
        data: `${timestampToDate(acconto.date).toLocaleDateString()}`,
        importo: acconto.amount + "â‚¬",
      })),
      columns: [
        { header: "Data Acconto", dataKey: "data" },
        { header: "Importo", dataKey: "importo" },
      ],
    });

    // Save the file
    doc.save(`${record.nomeCliente}_${timestampToDate(record.dataInizio).toLocaleDateString()}.pdf`);
    setIsLoading(false)
  };

  return (
    <Flex justifyContent="center" minHeight="100vh">
      <Box maxWidth="1500px">
        <Navbar />
        <Box border="1px solid grey" p={4} borderRadius="md">
          <Grid templateColumns={["repeat(3, 1fr)"]} gap={6} mb={6}>
            <Box p={4} border="1px solid grey" borderRadius="md">
              <Box>
                <FieldTitle title="Cliente" />
                <Text textAlign={'center'}>{record.nomeCliente}</Text>
              </Box>
            </Box>
            <Box
              p={4}
              border="1px solid grey"
              borderRadius="md"
              textAlign="center"
            >
              <Box>
                <FieldTitle title="Stato" />
                <Text textAlign={'center'}>{selectedStatus}</Text>
              </Box>
            </Box>
            <Box
              p={4}
              border="1px solid grey"
              borderRadius="md"
              textAlign="center"
            >
              <Box>
                <FieldTitle title="Ore Lavorate" />
                <Text textAlign={'center'}>{record.oreLav}</Text>
              </Box>
            </Box>
          </Grid>
          <Grid templateColumns={["repeat(2, 1fr)"]} gap={6} mb={6}>
            <Box
              p={4}
              border="1px solid grey"
              borderRadius="md"
              textAlign="center"
            >
              <Box>
                <FieldTitle title="Data Inizio Lavorazione" />
                <Text>{timestampToDate(record.dataInizio).toLocaleDateString()}</Text>
              </Box>
            </Box>
            <Box
              p={4}
              border="1px solid grey"
              borderRadius="md"
              textAlign="center"
            >
              <Box>
                <FieldTitle title="Data Fine Lavorazione" />
                <Text textAlign={'center'}>{timestampToDate(record.dataFine).toLocaleDateString()}</Text>
              </Box>
            </Box>
          </Grid>
          <Grid templateColumns={["repeat(1, 1fr)"]} gap={6} mb={6}>
            <Box>
              <FieldTitle title="Titolo lavorazione" />
              <Text textAlign={'center'}>{record.titolo}</Text>
            </Box>
          </Grid>
          <Grid
            templateColumns={["repeat(1, 1fr)", "repeat(5, 1fr)"]}
            gap={4}
            mt={8}
          >
            <Box>
              <FieldTitle title="Marca" />
              <Text textAlign={'center'}>{record.veicolo.marca}</Text>
            </Box>
            <Box>
              <FieldTitle title="Anno" />
              <Text textAlign={'center'}>{record.veicolo.anno}</Text>
            </Box>
            <Box>
              <FieldTitle title="Targa" />
              <Text textAlign={'center'}>{record.veicolo.targa}</Text>
            </Box>
            <Box>
              <FieldTitle title="Chilometraggio" />
              <Text textAlign={'center'}>{record.veicolo.km}</Text>
            </Box>
            <Box>
              <FieldTitle title="Cavalli" />
              <Text textAlign={'center'}>{record.veicolo.cavalli}</Text>
            </Box>
          </Grid>
          <Grid templateColumns={["repeat(2, 1fr)"]} gap={6} mt={8}>
            <Box>
              <FieldTitle title="Modello" />
              <Text textAlign={'center'}>{record.veicolo.modello}</Text>
            </Box>
            <Box>
              <FieldTitle title="Vim" />
              <Text textAlign={'center'}>{record.veicolo.vim}</Text>
            </Box>
          </Grid>
          <Grid templateColumns={["repeat(1, 1fr)"]} gap={6} mt={6}>
            <Box>
              <FieldTitle title="Tipo Motore" />
              <Text textAlign={'center'}>{record.veicolo.tipomotore}</Text>
            </Box>
          </Grid>
          <Grid templateColumns={["repeat(2, 1fr)"]} gap={6} mt={6}>
            <Box
              p={4}
              border="1px solid grey"
              borderRadius="md"
              textAlign="center"
            >
              <Flex justifyContent="center" alignItems="center" mb={10}>
                <Heading size="lg">Pezzi</Heading>
              </Flex>
              {pezzi.map((item: any, idx: number) => {
                //console.log(item)
                return (
                  <Grid
                    key={idx}
                    templateColumns={["repeat(1, 1fr)", "repeat(4, 1fr)"]}
                    gap={6}
                    mt={4}
                    border="1px solid grey"
                    p={4}
                    borderRadius="md"
                  >
                    <Text>{item.name}</Text>
                    <Text>{item.qta}</Text>
                    <Text>{item.price}</Text>
                    <Text>{item.fornitor}</Text>
                  </Grid>
                );
              })}
            </Box>
            <Box
              p={4}
              border="1px solid grey"
              borderRadius="md"
              textAlign="center"
            >
              <Flex justifyContent="center" alignItems="center" mb={10}>
                <Heading size="lg">Acconti</Heading>
              </Flex>
              {acconti.map((item: any, idx: number) => {
                //console.log(item)
                return (
                  <Grid
                    key={idx}
                    templateColumns={["repeat(1, 1fr)", "repeat(3, 1fr)"]}
                    gap={6}
                    mt={4}
                    border="1px solid grey"
                    p={4}
                    borderRadius="md"
                  >
                    <Text>{item.payment}</Text>
                    <Text>{item.amount}</Text>
                    <Text>{item.date.seconds}</Text>
                  </Grid>
                );
              })}
            </Box>
          </Grid>
          <Grid
            templateColumns={["repeat(1, 1fr)", "repeat(1, 1fr)"]}
            gap={6}
            mt={8}
          >
            <Box>
              <FieldTitle title="Note" />
              <Text textAlign={'center'}>{record.note}</Text>
            </Box>
          </Grid>
          <Flex justifyContent="center" mt={10}>
            <Button colorScheme="gray" onClick={() => downloadFile()}>
              {isLoading ? <Spinner /> : "Scarica PDF"}
            </Button>
          </Flex>
        </Box>
      </Box>
    </Flex>
  );
};

export default VisualizationPage;
